//     <footer className="footer">
//       <p>&copy; {new Date().getFullYear()} Your Company Name. All rights reserved.</p>
//     </footer>
//   );
// }
function Footer() {
    return (
      <footer className="footer">
        <div className="footer-content">
          <div className="descriptor-typing">
            <Typewriter
              options={{
                strings: descriptors,
                autoStart: true,
                loop: true,
                delay: 100,
                deleteSpeed: 200,
                cursor: "|",
                pauseFor: 10000
              }}
            />
          </div>
        </div>
      </footer>
    );
  }
  

export default Footer;
